import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <></>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload. This is project to learn ReactJS.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

const Header = () => {
  return (
    <div className="menu">
        <a>Home</a>
        <a>News</a>
        <a>Messages</a>
    </div>
  )
}

export default App;
